import { Injectable } from '@angular/core';
import {Observable} from "rxjs";
import {PlayerProfileRm} from "./player-profile.rm";
import {HttpClient} from "@angular/common/http";

@Injectable({
  providedIn: 'root'
})
export class PlayerProfilesService {
  constructor(private http: HttpClient) {}

  getPlayerProfile(id: number): Observable<PlayerProfileRm[]>{
    const path = `${window.or}${this.config.playerProfilesEndpoint}`;
    return this.http.get<PlayerProfileRm[]>("./playerprofiles");
  }
}
